import React from "react";
import { Link } from "react-router-dom";
import "../styles/NavBar.css";
import logo from "../assets/tic-logo.png";
import homeIcon from "../assets/home.png";
import turnosIcon from "../assets/turnos.png";

const NavBar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo-container">
        <img src={logo} alt="TIC Logo" className="navbar-logo" />
      </div>
      <ul className="navbar-links">
        <li className="navbar-item">
          <Link to="/">
            <img src={homeIcon} alt="Inicio" className="navbar-icon" />
            Inicio
          </Link>
        </li>
        <li className="navbar-item">
          <Link to="/turnos">
            <img src={turnosIcon} alt="Reservar Turno" className="navbar-icon" />
            Reservar Turno
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
